  true,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation.nn               Primary roads are generally divided, limited-access highways
  within the interstate highway system or under State management, and are distinguished
  by then               presence of interchanges.  These highways are accessible by
  ramps and may include some toll highways.  The MAF/TIGER Feature Classification
  Code (MTFCC)n               is S1100 for primary roads.  n            \",\n\t\"license_title\":
